import React from 'react'
import dataSlide from './dataSlidebar.json'


export default function Func(props) {




    if (props.pth=="/"){
        return (
            <div>
              <div>
                
                <div class="list-type5 mt-5">
                  <ol>
                                {props.pr.map((it) => 
                                <li>{it.title}</li>
                                )}
                  </ol>
                </div>
              </div>
            </div>
          )
        }

    if (props.pth=="/PremierAcCours"){
        return (
            <div>
              <div>
                
                <div class="list-type5 mt-5">
                  <ol>
                                {props.pr.map((it) => 
                                <li>{it.title}</li>
                                )}
                  </ol>
                </div>
              </div>
            </div>
        )
        }



 
}
